# and at our labels
np.unique(train_labels)

"""# what is the problem we are trying to solve?
*   As we can see, we have imagees of digits from 0-9 and labels from 0-9 . we are trying to build a models that correctly classifies the digits in the image.

**2.Data Introduction to Computer Vision**



**what is Computer Vision?**

1.   Computer vision is the field of how computer can gain understanding from images and videos. It includes task such as **Image recognition ** and **object detection **. Deep Learning is seen as the state of the art technology for solving Computer Vision problems.

**Why is Deep Learning particulary good as it?**

*   the Layers within a deep Learning model are good for identifyig and modelling the differernt aspects of an image( such as edges , parts of faces, and other important parts of an image). the meaning that each layer extracts can be built up to form represntation for lots of differnt image types that can be classified.
* In Particular, convolutional layers are good at extracting representation from image data and they from the basis of deep learning models for image recognition. The ability to build larger models that consist of these convolutional layers,and to train them with more and more data(thanks to increasing compute power),led to leap forward in state of the art for computer vision.

**How does it works?**


*   Every image is reresented by an array of numbers. you may have noticed this when we looked at the shpae of the image we were processing. this sharper represents the number of pixels in an image, and each pixel has numerical value. this numerical value maps to a colour values that is displayed, it is also what we use as input values to our model.
"""

#let start by looking at the shape of an image 
# we can see that is 28*28 pixels
train_images[0].shape

## we can also see that these pixels are represeted in an array of number 
train_images[0]

## we need plt.imshow()-or another library such as OpenCv or PIL to outpur an image   from tis array
plt.imshow(train_images[0])

"""**what do the the array value mean?**


*   Each value leads to a colour for the pixel that the array value represents. Actually what colour is diplayed depends somewhat on the number of colour channels the array has. we have only one channel in this datasets. This is grayscale channel. Typically, we will see three channels for colour images, with each channel representinf one or Red, Green, Blue. A Vlaue in the one Channel will display a differnt colour than a value in another channel
*   its worth here that there are typically values (0-255) available in each channel, majing a total combination of c.16.8 colour available per three channel image1
"""

# we now need to reshap the data to add a colour channel 
train_images = train_images.reshape((60000, 28, 28, 1))
test_images = test_images.reshape((10000, 28, 28, 1))

#@ we can view the new shape
train_images.shape

# and normalize the data
train_images, test_images = train_images/ 255.0, test_images /255.0

"""**Model Building**

**3.1 Convolutional Models**


*   A Convolutional Neural Network (CNN) contains both dense and convolutional layers. the convolutional layer from the base of the model and extracts represenation from the image. the dense layer from the head of hte model and takes this represenation and maps it to our outpur classes 
*  A convolutional layer takes our image as it (subject to any preprocessing to get it in a standard shape or augmented to ass add noise and variety to the dataset) that is, we do not need to flatten the image into a 1D array. we flatten the array after our final convolutional layer and prior to passinf our input to the dense layer.
![image.png](data:image/png;base64,)
"""

# lets build pur convolutional base
## we use the sequential API but use .add()
# build mdoel using sequential 
model =models.Sequential()

# start adding layer. input shape has been defined, including the channel value we added via reshape earlier 

model.add(layers.Conv2D(32, (3,3), activation= 'relu', input_shape=( 28, 28, 1)))
# max pooling layers
model.add(layers.MaxPooling2D((2,2)))
# this is then repeated to build 
model.add(layers.Conv2D(64, (3, 3), activation='relu'))
# max pooling layers
model.add(layers.MaxPooling2D((2,2)))
# additional convolutional layer
model.add(layers.Conv2D(64, (3,3), activation='relu'))

#print model 
model.summary()

"""**How do we get to the parameter count ?**


*  The parameters of a convolutional layer are defined by:![image.png](data:image/png;base64,)
*   The Bias term is  a value of 1 so the number of parameters for the first convolutional layer is 
![image.png](data:image/png;base64,)

**What about the classification layer?**

*   A Convolutional based needs a classification layer to take the information extracted from an image and map it to output classes.
*  We take the final output shape of the convolutional layer and faltten it to 1D array . we then define our output layer,which in this instance is layer of 10 with a softmax activation function. we have also added an additional layer to provide additional parameters between the flattened
"""

# flatten
model.add(layers.Flatten())
# add a fully connected layer
model.add(layers.Dense(64, activation='relu'))
# add the output layer , fully connnected layer with softmax activation 
model.add(layers.Dense(10, activation='softmax'))

# Complete model summary 
model.summary()

